import React from 'react';
import classes from './underCategories.css';
import Radium from 'radium';

let style = {
    firstContainer: {
    },
    secondContainer: {
    }
}

const underCategories = (props) => {
    style = {
        firstContainer: {
            backgroundColor: 'rgb(210, 47, 47)',
            margin: '0px 2px',
            height: '550px',
            width: '25%',
            flexDirection: 'column'
        },
        secondContainer: {
            backgroundColor: 'rgb(210, 47, 47)',
            margin: '0px 2px',
            height: '550px',
            width: '75%',
            flexDirection: 'column'
        }
    }

    return (
        <div>
            <div style={style.firstContainer} className={classes.hoverCategorie}>
                <div className={classes.btnhover}>
                    <div className={classes.decision}>
                        <button className={classes.button + ' ' + classes.buttonPMSE}><a href="http://www.arcep.fr/uploads/tx_gsavis/15-0830.pdf">Décision</a></button>/
                    </div>
                    <div className={classes.alignContainer}>
                    </div>
                </div>
            </div>
            <div style={style.secondContainer} className={classes.hoverCategorie}>
                <div className={classes.btnhover}>
                    <div className={classes.decision}>
                        <button className={classes.button + ' ' + classes.buttonPMSE}><a href="https://www.arcep.fr/uploads/tx_gsavis/16-1130.pdf">Décision</a></button>
                    </div>
                    <div className={classes.alignContainer}>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Radium(underCategories);
